import React from 'react';

function f() {
    let x = 0;
    console.log('aaa')
}
const Main = () => {
    const html =
        <main>
            <form onSubmit={f}>
                <label>PVM tarifas<select onChange={f} name="vat_percent" id="vat_percent">
                    <option value="21">21%</option>
                    <option value="9">9%</option>
                    <option value="5">5%</option>
                </select></label>

                <label>Suma (be PVM)<input onChange={f} type="text" id="sumBePvm" defaultValue={0} /></label>

                <label>PVM suma<input type="text" id="sumPvm" defaultValue={''} disabled="disabled" /></label>

                <label>Bendra suma (su PVM) <input onChange={f} type="text" id="total" defaultValue={0} /></label>

            </form>

            <div>Įveskite sumą be PVM arba bendrą sumą (su PVM).</div>
        </main>
    return html;
}
export default Main;
